import './App.css';
import { useState } from "react";

export default function LPSweepNotes() {
  const [Lpfloor1, setFloor1] = useState('');
  const [Lpfloor2, setFloor2] = useState('');

  const floor1Change = (event) => {
    setFloor1(event.target.value);
  };

  const floor2Change = (event) => {
    setFloor2(event.target.value);
  };

  return (
    <div className="lp-sweep-notes">
      <div className="input-cards">
        <div className="card">
        <h1>Les Prince</h1>
          <label>Floor 1 </label>
          <input type="text" value={Lpfloor1} onChange={floor1Change} />
        </div>
        <div className="card">
        <h1>WoodStock</h1>
          <label>Floor 2 </label>
          <input type="text" value={Lpfloor2} onChange={floor2Change} />
        </div>
      </div>
      <div className="output-card">
      <h1>Sweep Notes</h1>
        <p>Floor 1: {floor1}</p>
        <p>Floor 2: {floor2}</p>
      </div>
    </div>
  );
}
